import React from 'react'

import {
  ButtonHome,
  ButtonUser,
  ButtonTeam,
  ContainerTab,
  TabBar,
} from '../../styles/components/Navigation'

export const Navigation = () => {
  return (
    <>
      <ContainerTab>
        <ButtonTeam />
        <ButtonHome />
        <ButtonUser />
        <TabBar />
      </ContainerTab>
    </>
  )
}
